import React from "react";
import styled from "styled-components";

const FooterDivStyle = styled.footer`
  display: flex;
  width: 100%;
  height: 10px;
`;

const Footer = () => {
  return <FooterDivStyle></FooterDivStyle>;
};

export default Footer;
